import React from "react";
import Cards from "./components/Cards";
import profile from "./images/profile_pic2.png";


const Projects = () => {
    return (
        <>
            <section className="header">
                <div className="container">
                    <h1 className="display-3 about_header mt-2 mb-4 text-center">
                        My Projects
                    </h1>
                    <div class="row row-cols-1 row-cols-md-2 row-cols-lg-4 g-4 mt-4">
                        <div class="col">
                            <Cards imgsrc="https://picsum.photos/800/600" alt="https://picsum.photos/200/150" title="A" text="lorem" link=""/>
                        </div>
                        <div class="col">
                            <Cards imgsrc="https://picsum.photos/800/600" alt="https://picsum.photos/200/150" title="A" text="lorem" link=""/>
                        </div>
                        <div class="col">
                            <Cards imgsrc="https://picsum.photos/800/600" alt="https://picsum.photos/200/150" title="A" text="lorem" link=""/>
                        </div>
                        <div class="col">
                            <Cards imgsrc="https://picsum.photos/800/600" alt="https://picsum.photos/200/150" title="A" text="lorem" link=""/>
                        </div>
                    </div>
                </div>
            </section>
        </>
    );
};

export default Projects;
